import React from 'react';
import { BookDetails } from '../queries/getBooks';
import { StringLiteral } from 'typescript';
import { Table, Text } from '@chakra-ui/react';

export interface ListBookDetail {
handleClick: () => void;
key: number;
title: string;
author: string;
description: string;
price: number;

}

const ListBookRow: React.FC<ListBookDetail> =({
handleClick,
key,
title,
author,
description,
price
}) => {
    return (
        <>
        <Table>
            <Text>{title}</Text>
            <Text>{description}</Text>
            <Text>{author}</Text>
            <Text>{price}</Text>
        </Table>
        </>
    )

}


export default ListBookRow;
